export const PageAllTopTitle = (props) => {
  const Title = () => {
    return (
      <div className="page_All_top_title">
        <h3>{props.title}</h3>
      </div>
    );
  };
  const TitleWithIcon = () => {
    return (
      <div className="page_All_top_title">
        <h3>
          <span>{props.link}</span> {props.title}
        </h3>
      </div>
    );
  };
  return props.link ? <Title /> : <TitleWithIcon />;
};
